<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Regional Trade Analysis Report</title>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/prop-types/15.8.1/prop-types.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/react/18.2.0/umd/react.production.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/react-dom/18.2.0/umd/react-dom.production.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/babel-standalone/7.23.2/babel.min.js"></script>
  <script src="https://unpkg.com/papaparse@latest/papaparse.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/recharts/2.15.0/Recharts.min.js"></script>
  <script src="https://cdn.tailwindcss.com"></script>
</head>
<body className="bg-gray-100 font-sans">
  <div id="root"></div>
  <script type="text/babel">
    const { createRoot } = ReactDOM;
    const { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } = Recharts;

    const App = () => {
      const [anzcertaData, setAnzcertaData] = React.useState([]);
      const [cufstaData, setCufstaData] = React.useState([]);
      const [andeanData, setAndeanData] = React.useState([]);
      const [worldExports, setWorldExports] = React.useState([]);

      React.useEffect(() => {
        const csvData = loadFileData("分析用.xlsx");
        Papa.parse(csvData, {
          header: true,
          dynamicTyping: true,
          skipEmptyLines: true,
          transformHeader: (header) => header.trim().replace(/^"|"$/g, ''),
          transform: (value, header) => {
            const cleaned = value.trim().replace(/^"|"$/g, '');
            const booleanMap = { "true": true, "false": false };
            const booleanValue = booleanMap[cleaned.toLowerCase()];
            return booleanValue !== undefined ? booleanValue : cleaned;
          },
          complete: (results) => {
            const data = results.data;
            const anzcertaIR = data.find(row => row['Country Group'] === 'ANZCERTA' && row['IR / RI'] === 'IR');
            const anzcertaRI = data.find(row => row['Country Group'] === 'ANZCERTA' && row['IR / RI'] === 'RI');
            const cufstaIR = data.find(row => row['Country Group'] === 'CUFSTA' && row['IR / RI'] === 'IR');
            const cufstaRI = data.find(row => row['Country Group'] === 'CUFSTA' && row['IR / RI'] === 'RI');
            const andeanIR = data.find(row => row['Country Group'] === 'ANDEAN PACT' && row['IR / RI'] === 'IR');
            const andeanRI = data.find(row => row['Country Group'] === 'ANDEAN PACT' && row['IR / RI'] === 'RI');

            const years = ['1960', '1970', '1975', '1985', '1990', '1995', '2000', '2005', '2010', '2015'];
            const formatData = (irRow, riRow) => years.map(year => ({
              year: parseInt(year),
              IR: irRow ? parseFloat(irRow[year]) || null : null,
              RI: riRow ? parseFloat(riRow[year]) || null : null,
            })).filter(d => d.IR !== null || d.RI !== null);

            setAnzcertaData(formatData(anzcertaIR, anzcertaRI));
            setCufstaData(formatData(cufstaIR, cufstaRI));
            setAndeanData(formatData(andeanIR, andeanRI));

            const worldExportRows = data.filter(row => row['Country Group'] === 'Total Export of wtw');
            const worldExportData = ['1995', '2000', '2005', '2010', '2015'].map(year => ({
              year: parseInt(year),
              exports: parseFloat(worldExportRows[0][year]) / 1e9 || null,
            })).filter(d => d.exports !== null);
            setWorldExports(worldExportData);
          },
          error: (err) => console.error('CSV Parsing Error:', err),
        });
      }, []);

      return (
        <div className="container mx-auto p-6 bg-white shadow-lg rounded-lg">
          <h1 className="text-3xl font-bold mb-4 text-center">Regional Trade Analysis Report</h1>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Introduction</h2>
            <p className="text-gray-700">
              Regional trade agreements (RTAs) play a significant role in shaping global trade patterns by fostering economic integration among member countries. This report examines three RTAs: the Australia-New Zealand Closer Economic Relations Trade Agreement (ANZCERTA), the Canada-United States Free Trade Agreement (CUFSTA), and the Andean Pact. Using data from 1960 to 2015, we analyze how intra-regional trade shares (IR) and global export shares (RI) have evolved. The research question is: How have these RTAs influenced IR and RI? We hypothesize that RTAs increase IR but may reduce RI due to trade diversion effects.
            </p>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Recent Trends</h2>
            <p className="text-gray-700">
              The data reveals distinct trends across the three RTAs. For ANZCERTA, IR rose from 5.7% in 1960 to a peak of 18.92% in 2010, before dropping to 5.45% in 2015, while RI declined from 2.4% to 1.38% over the same period. CUFSTA's IR increased from 38.0% in 1985 to 50.85% in 2010, then fell to 31.1% in 2015, with RI decreasing from 16.7% to 11.83%. The Andean Pact saw IR grow from 0.7% in 1960 to 8.14% in 2015, notably jumping from 4.6% in 1990 to 8.51% in 1995 after the 1993 free trade zone, while RI fell from 2.9% to 0.62%.
            </p>
            <p className="text-gray-700">
              <strong>Interesting Fact:</strong> The Andean Pact's IR surged dramatically post-1993, suggesting that policy changes like free trade zones can significantly boost regional trade, even in developing economies.
            </p>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Visualizations</h2>

            <div className="mb-6">
              <h3 className="text-xl font-medium mb-2">ANZCERTA Trade Trends</h3>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={anzcertaData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="year" label={{ value: 'Year', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                  <YAxis label={{ value: 'Percentage (%)', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                  <Tooltip formatter={(value) => value.toFixed(2) + '%'} />
                  <Legend />
                  <Line type="monotone" dataKey="IR" stroke="#8884d8" name="Intra-Regional Share" />
                  <Line type="monotone" dataKey="RI" stroke="#82ca9d" name="Global Export Share" />
                </LineChart>
              </ResponsiveContainer>
            </div>

            <div className="mb-6">
              <h3 className="text-xl font-medium mb-2">CUFSTA Trade Trends</h3>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={cufstaData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="year" label={{ value: 'Year', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                  <YAxis label={{ value: 'Percentage (%)', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                  <Tooltip formatter={(value) => value.toFixed(2) + '%'} />
                  <Legend />
                  <Line type="monotone" dataKey="IR" stroke="#8884d8" name="Intra-Regional Share" />
                  <Line type="monotone" dataKey="RI" stroke="#82ca9d" name="Global Export Share" />
                </LineChart>
              </ResponsiveContainer>
            </div>

            <div className="mb-6">
              <h3 className="text-xl font-medium mb-2">Andean Pact Trade Trends</h3>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={andeanData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="year" label={{ value: 'Year', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                  <YAxis label={{ value: 'Percentage (%)', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                  <Tooltip formatter={(value) => value.toFixed(2) + '%'} />
                  <Legend />
                  <Line type="monotone" dataKey="IR" stroke="#8884d8" name="Intra-Regional Share" />
                  <Line type="monotone" dataKey="RI" stroke="#82ca9d" name="Global Export Share" />
                </LineChart>
              </ResponsiveContainer>
            </div>

            <div className="mb-6">
              <h3 className="text-xl font-medium mb-2">World Total Exports (Billions USD)</h3>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={worldExports} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="year" label={{ value: 'Year', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                  <YAxis label={{ value: 'Exports (B USD)', angle: -90, position: 'insideLeft', fontSize: 12 }} tickFormatter={(value) => (value / 1000).toFixed(1) + 'T'} />
                  <Tooltip formatter={(value) => (value / 1000).toFixed(2) + ' Trillion USD'} />
                  <Legend />
                  <Line type="monotone" dataKey="exports" stroke="#ff7300" name="World Exports" />
                </LineChart>
              </ResponsiveContainer>
            </div>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Literature Review</h2>
            <p className="text-gray-700">
              Research on RTAs suggests they often enhance intra-regional trade through trade creation, where member countries replace high-cost domestic production with imports from partners. However, trade diversion can occur when imports shift from efficient non-members to less efficient members due to preferential tariffs. Studies on ANZCERTA, such as Scollay et al. (2011), note its role as a benchmark, highlighting both trade creation and diversion effects (<a href="https://bookshop.iseas.edu.sg/publication/134">ANZCERTA Study</a>). For CUFSTA, analyses indicate significant trade growth, though debates persist on diversion impacts. The Andean Pact's 1993 free trade zone markedly increased intra-regional trade, as noted in regional studies.
            </p>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Model (Theoretical Framework)</h2>
            <p className="text-gray-700">
              Viner's (1950) customs union theory provides a framework for analyzing RTAs. Trade creation enhances welfare by replacing high-cost domestic production with lower-cost partner imports. Trade diversion, conversely, may reduce welfare by shifting imports from efficient non-members to less efficient members. The net welfare effect depends on the balance between these forces, guiding our analysis of IR and RI trends.
            </p>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Empirical Results</h2>
            <p className="text-gray-700">
              The data shows that IR increased post-RTA implementation across all regions, suggesting trade creation. For ANZCERTA, IR rose significantly after 1983, though the 2010 peak and 2015 drop warrant further investigation. CUFSTA's IR peaked in 2010, indicating strong integration, but RI declined, possibly due to global competition. The Andean Pact's IR surge post-1993 aligns with policy changes, while RI stabilized after an initial decline.
            </p>

            </table>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Case Studies</h2>
            <p className="text-gray-700">
              The Andean Pact offers a compelling case. The 1993 free trade zone led to a sharp IR increase from 4.6% in 1990 to 8.51% in 1995, driven by reduced tariffs and trade barriers. This sustained growth highlights the impact of policy reforms in developing regions.
            </p>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Policy Implications</h2>
            <p className="text-gray-700">
              RTAs can boost regional trade and integration, but policymakers must address potential trade diversion to maintain global competitiveness. Open regionalism, encouraging broader trade liberalization, could maximize welfare gains.
            </p>
          </section>

          <section className="mb-8">
            <h2 className="text-2xl font-semibold mb-2">Conclusion</h2>
            <p className="text-gray-700">
              RTAs like ANZCERTA, CUFSTA, and the Andean Pact generally increase IR, but RI trends vary, with declines in ANZCERTA and CUFSTA suggesting possible trade diversion. The Andean Pact's success post-1993 underscores policy impacts. Further research could quantify these effects using econometric models.
            </p>
          </section>
